import React , {useEffect, useState} from "react";
import {  Link , useParams } from "react-router-dom";
import axios from "axios";
import "../styles/Mainpage.css";

function Mainpage(){
    
    const [user , setUser]=useState({
        email:"" , pass:"" , name:""
    });

    const { id }=useParams();

    function Loaddata(){
        axios.get("/get-specific/"+id)

        .then((res)=>{
            console.log(res);
            setUser(res.data);

        })
        .catch((err)=>{
            console.log(err);
        })
    }

    useEffect(()=>{
        Loaddata();
    } , []);



    return(



        <>
        <div id="welcome">
            <b>Welcome {user.email}</b>
        </div>



        <div>
        <Link to={"/front/"+id}>
        <button  id="BUT">Post</button>
        </Link>
        </div>
        </>
    )

}
export default Mainpage;
